import React, { useEffect, useState } from 'react'
import './styles/Navbar.css'

import{NavLink}from "react-router-dom";
import { useSelector } from 'react-redux';

const Navbar = () => {
  const[staff_token1,setStaff_token1]=useState(null);
  let staff_token2=useSelector(state=>state.staff.login.staff_token);

  const[student_token1,setStudent_token1]=useState(null);
  let student_token2=useSelector(state=>state.student.login.student_token);
  let catchToken=()=>{
    setStaff_token1(sessionStorage.getItem("staff_token"))
    setStudent_token1(sessionStorage.getItem("student_token"))
  }
  useEffect(()=>{
    catchToken
  },[student_token2, staff_token2])

  return (
    <div className='nav-wrapper'>
     <NavLink to="/" className="navbar-logo"><img src={require("../E-removebg-preview.png")} alt="" style={{height:"3vw"}} /></NavLink>
     <div className='menu'>
       {staff_token1||staff_token2 ?(
        <ul>
          <NavLink to="/staff" className={({ isActive }) => (isActive ? 'menulinks-active' : 'menulinks')}>Staff</NavLink>
        </ul>
        ):
       (<>
       {student_token1||student_token2 ?(
        <ul>
            <NavLink to="/student" className={({ isActive }) => (isActive ? 'menulinks-active' : 'menulinks')}>Student</NavLink>
        </ul>
        ):(<>
        <ul>
          <NavLink to="/staff" className={({ isActive }) => (isActive ? 'menulinks-active' : 'menulinks')}>Staff</NavLink>
        </ul>
        <ul>
            <NavLink to="/student" className={({ isActive }) => (isActive ? 'menulinks-active' : 'menulinks')}>Student</NavLink>
        </ul>
        </>)}
       </>)}
        </div>
    </div>
  )
}

export default Navbar
